export class Posting {
 	id: number;
	title: string;
	content: string;
	lastModified: string;
	enabled: boolean;

	constructor() {
		this.id = -1;
		this.title = "";
		this.content = "";
		this.lastModified = "";
		this.boolean = false;
	}
}
